import{_ as r,a,H as i,S as o,D as n,o as s}from"./chunks/framework.DX1C7ho2.js";const u=JSON.parse('{"title":"Monthly Updates [November]","description":"Nov 2024 updates","frontmatter":{"title":"Monthly Updates [November]","description":"Nov 2024 updates","date":"2024-11-01T00:00:00.000Z","next":false,"aside":"right","prev":false,"footer":true},"headers":[],"relativePath":"posts/nov-2024.md","filePath":"posts/nov-2024.md"}'),l={name:"posts/nov-2024.md"};function d(p,e,h,f,m,c){const t=n("Post");return s(),a("div",null,[i(t,{authors:"nbats"}),e[0]||(e[0]=o('<div class="info custom-block"><p class="custom-block-title">INFO</p><p>These update threads only contains major updates. If you&#39;re interested in seeing all minor changes you can follow our <a href="https://github.com/Lost Pages/Lost Pagesedit/commits/main" target="_blank" rel="noreferrer">Commits Page</a> on GitHub or <a href="https://redd.it/17f8msf" target="_blank" rel="noreferrer">Updates Channel</a> in Discord.</p></div><h3 id="wiki-updates" tabindex="-1">Wiki Updates <a class="header-anchor" href="#wiki-updates" aria-label="Permalink to &quot;Wiki Updates&quot;">​</a></h3><ul><li><p>Added new Lost Pages backup domain: <code>Lost Pages.lol</code></p></li><li><p>The <a href="https://github.com/kenhendricks00/Lost Pages-SafeGuard" target="_blank" rel="noreferrer">Lost Pages SafeGuard</a> extension is ready to be tested. Let us know how it works for you guys, and ty to everyone who made it happen.</p></li><li><p>Split <a href="https://lostpages.netlify.app/downloadpiracyguide#foss-sites" target="_blank" rel="noreferrer">FOSS</a> and <a href="https://lostpages.netlify.app/downloadpiracyguide#freeware-sites" target="_blank" rel="noreferrer">Freeware</a> into separate sections, and cleaned up formatting: <a href="https://i.ibb.co/M5F1Dk7/image.png" target="_blank" rel="noreferrer">before vs after</a>.</p></li><li><p>Split <a href="https://lostpages.netlify.app/text-tools#text-editors" target="_blank" rel="noreferrer">Text Editors</a> and <a href="https://lostpages.netlify.app/text-tools#note-taking" target="_blank" rel="noreferrer">Note-Taking</a> into separate sections, added labels, and removed any that were low quality or abandoned.</p></li><li><p>Split <a href="https://lostpages.netlify.app/audiopiracyguide#radio-streaming" target="_blank" rel="noreferrer">Radio Stations</a> and <a href="https://lostpages.netlify.app/audiopiracyguide#podcast-streaming" target="_blank" rel="noreferrer">Podcasts</a> into separate sections.</p></li><li><p>Added tags to bookmark managers, and removed ones that looked low quality: <a href="https://i.ibb.co/nczmmrv/3453453453.jpg" target="_blank" rel="noreferrer">before vs after</a>.</p></li><li><p>Added tags to Remote Desktop, and removed any that looked low quality: <a href="https://i.ibb.co/jw87F2W/image.png" target="_blank" rel="noreferrer">before vs after</a>.</p></li><li><p>Added tags to Online Image Editors, and removed any that didn&#39;t stand out: <a href="https://i.ibb.co/hFwBD6n/34534534.jpg" target="_blank" rel="noreferrer">before vs after</a>.</p></li><li><p>Added tags to Link in Bio, and removed any that seemed low quality: <a href="https://i.ibb.co/BjZ3SpR/image.png" target="_blank" rel="noreferrer">before vs after</a>.</p></li><li><p>Added a <a href="https://lostpages.netlify.app/gamingpiracyguide#special-interest" target="_blank" rel="noreferrer">Special Interests</a> section to gaming, to help debloat the main DDL section a bit.</p></li></ul><hr><h3 id="stars-added-⭐" tabindex="-1">Stars Added ⭐ <a class="header-anchor" href="#stars-added-⭐" aria-label="Permalink to &quot;Stars Added ⭐&quot;">​</a></h3><ul><li><p>Starred <a href="https://lostpages.netlify.app/social-media-tools#fediverse-tools" target="_blank" rel="noreferrer">Bluesky</a> in Fediverse Tools as everyone is leaving Twitter for it now.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/video-tools#video-editors" target="_blank" rel="noreferrer">Kdenlive</a> in Video Editors. Open-source, feature-rich, multi-platform editor.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/audiopiracyguide#game-soundtracks" target="_blank" rel="noreferrer">Khinsider</a> in Game Soundtracks. Popular soundtrack site with big library.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/video-tools" target="_blank" rel="noreferrer">Camo</a> in Video Tools. Allows you to use any device as a webcam.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/storage#live-radio" target="_blank" rel="noreferrer">FMSTREAM</a> in Radio Streaming. The biggest online radio directory on the internet.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/android-iosguide#android-internet" target="_blank" rel="noreferrer">Thunderbird</a> in Android Internet as its just a better version of K-9 Mail.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/img-tools#online-editors" target="_blank" rel="noreferrer">Pixlr</a> in Online Image Editors. Feature-rich editor with nice UI. Has daily limit but it can be bypassed with the script linked.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/social-media-tools#discord-tools" target="_blank" rel="noreferrer">x266.mov</a> in Discord Tools. Allows you to embed large videos on Discord.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/audiopiracyguide#spotify-tools" target="_blank" rel="noreferrer">Playlists.cloud</a> in Spotify Tools. Unlimited playlist transfer between Spotify / Apple Music.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/edupiracyguide#downloading" target="_blank" rel="noreferrer">InfiCourses</a> in Course DDL. Big library with courses tough to find elsewhere.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/img-tools#drawing" target="_blank" rel="noreferrer">Excalidraw</a> in Drawing Tools. Feature-rich compared to similar web apps.</p></li><li><p>Went through <a href="https://lostpages.netlify.app/storage#sms-verification-sites" target="_blank" rel="noreferrer">SMS verification</a> and starred ones that stood out the most.</p></li></ul><hr><h3 id="things-removed" tabindex="-1">Things Removed <a class="header-anchor" href="#things-removed" aria-label="Permalink to &quot;Things Removed&quot;">​</a></h3><ul><li><p>Removed Mutaz as they no longer host cracked software.</p></li><li><p>Removed Feynas free tier is too limited now.</p></li><li><p>Unstarred BetterDiscord as it runs poorly for many people due to bad optimization, and there are better options like Vencord.</p></li><li><p>Unstarred OlaMovies as they now require google logins.</p></li><li><p>Unstarred PDALife as many apps are outdated, their official app isn&#39;t maintained, and there are better sites.</p></li><li><p>Unstarred Not Diamond as it isn&#39;t unlimited anymore.</p></li><li><p>Unstarred ElevenLabs as its capped at 10 mins ⁠limiting its usefulness.</p></li></ul>',9))])}const b=r(l,[["render",d]]);export{u as __pageData,b as default};
